const getNastavnici = async (state = [], action) => {
  /* if (action.type === 'GET_NASTAVNICI') {
    return state;
  } */
  if (action.type === 'GET_NASTAVNICI') {
    const nast = await fetch('http://localhost:3001/nastavnici');
    const response = nast.json();
    const resp = await response;
    console.log(resp);
    return resp;
  }
  return state;
};

export default getNastavnici;
